import React, { useState } from 'react';

function App() {
    const [formData, setFormData] = useState({
        oncampus: '',
        withfriends: '',
        alone: '',
        selfmade: ''
    });

    const [showResults, setShowResults] = useState(false);
    const [loading, setLoading] = useState(false);
    const [results, setResults] = useState({
        socialScore: 0,
        independenceScore: 0,
        campusScore: 0,
        totalMeals: 0
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        // Get form values
        const oncampus = parseInt(formData.oncampus) || 0;
        const withfriends = parseInt(formData.withfriends) || 0;
        const alone = parseInt(formData.alone) || 0;
        const selfmade = parseInt(formData.selfmade) || 0;

        // Show results section
        setShowResults(true);
        setLoading(true);

        // Simulate processing time
        setTimeout(() => {
            // Calculate nutritional behavior scores
            const totalMeals = oncampus + withfriends + alone + selfmade;
            const socialScore = Math.round(((withfriends + oncampus) / Math.max(totalMeals, 1)) * 100);
            const independenceScore = Math.round((selfmade / Math.max(totalMeals, 1)) * 100);
            const campusScore = Math.round((oncampus / Math.max(totalMeals, 1)) * 100);

            setResults({
                socialScore,
                independenceScore,
                campusScore,
                totalMeals
            });

            setLoading(false);
        }, 1500);
    };

    return (
        <div className="app">
            <div className="container">
                <div className="header">
                    <h1>SDSU Nutritional Health Assessment</h1>
                    <p>Student Dining Behavior Analysis</p>
                    <div className="subtitle">For Staff Use - Attrition Risk Data Collection</div>
                </div>

                <form onSubmit={handleSubmit} className="nutritional-form">
                    <div className="form-group">
                        <label htmlFor="oncampus">
                            Eat at an on-campus eatery (Food trucks, restaurants, food court)
                        </label>
                        <input
                            type="number"
                            id="oncampus"
                            name="oncampus"
                            value={formData.oncampus}
                            onChange={handleInputChange}
                            placeholder="Times per week"
                            min="0"
                            max="21"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="withfriends">Eat with friends</label>
                        <input
                            type="number"
                            id="withfriends"
                            name="withfriends"
                            value={formData.withfriends}
                            onChange={handleInputChange}
                            placeholder="Times per week"
                            min="0"
                            max="21"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="alone">Eat alone</label>
                        <input
                            type="number"
                            id="alone"
                            name="alone"
                            value={formData.alone}
                            onChange={handleInputChange}
                            placeholder="Times per week"
                            min="0"
                            max="21"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="selfmade">Prepared a meal on my own</label>
                        <input
                            type="number"
                            id="selfmade"
                            name="selfmade"
                            value={formData.selfmade}
                            onChange={handleInputChange}
                            placeholder="Times per week"
                            min="0"
                            max="21"
                        />
                    </div>

                    <button type="submit" className="submit-btn">
                        Analyze Nutritional Patterns
                    </button>
                </form>

                {showResults && (
                    <div className={`results ${showResults ? 'fade-in' : ''}`}>
                        <h3>ðŸ“Š Nutritional Health Analysis</h3>
                        {loading ? (
                            <div className="loading">Processing nutritional data...</div>
                        ) : (
                            <div className="results-content fade-in">
                                <div className="result-item">
                                    <span className="result-label">Social Dining Score</span>
                                    <span className="result-value">{results.socialScore}%</span>
                                </div>
                                <div className="result-item">
                                    <span className="result-label">Independence Index</span>
                                    <span className="result-value">{results.independenceScore}%</span>
                                </div>
                                <div className="result-item">
                                    <span className="result-label">Campus Engagement</span>
                                    <span className="result-value">{results.campusScore}%</span>
                                </div>
                                <div className="result-item">
                                    <span className="result-label">Weekly Meals Total</span>
                                    <span className="result-value">{results.totalMeals}</span>
                                </div>
                            </div>
                        )}
                    </div>
                )}
            </div>
        </div>
    );
}

export default App;
